import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import InputBase from '@material-ui/core/InputBase';
import AppBar from '@material-ui/core/AppBar';
import products from '../products'
import { Link} from "react-router-dom";
import { connect }                  from "react-redux"

import { logoutUser } from "../../store/actions/login"

import './PrivateHeader.css'

const styles = {
  input: {
    marginLeft: 8,
    marginRight: 8,
    flex: 1,
    backgroundColor: "white",
    paddingLeft: 10,
    paddingRight: 10,
    width: 500
  }
};

class PrivateHeader extends Component {

  constructor(props) {
    super(props)

    this.state = {search: ''}
  }

  render() {
    const { classes } = this.props;

    return (
      <div className="private-header">
        <div className="page-links">
          <h5>
            <span className="page-link" onClick={() => this.props.history.push("/home")}>HOME</span>

            &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;

            <span className="page-link" onClick={() => console.log("favourites", this)}>FAVOURITES</span>

              &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;

              <span className="page-link" onClick={() => this.props.logoutUser()}>LOGOUT</span>
          </h5>
        </div>

        <div className="header-content">
          <h1 className="company-name">The Beer Bank</h1>

          <p>Find your favourite beer here</p>
          <InputBase id="search" className={classes.input} placeholder="Search for beer name"
            onKeyPress={() => {
              this.setState({search: document.getElementById('search').value})
            }}/>
        </div>
      </div>
    );
  }
}

PrivateHeader.propTypes = {
  history: PropTypes.object.isRequired,
  classes: PropTypes.object.isRequired,
  logoutUser: PropTypes.func.isRequired,
};

const mapDispatchToProps = (dispatch) => ({
  logoutUser       : () => dispatch(logoutUser())
})

export default withStyles(styles)(connect(null, mapDispatchToProps)(PrivateHeader));
